 */

import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "../components/Pages/Home";
import SignIn from "../components/Pages/SignIn";
import SignUp from "../components/Pages/SignUp";
import ForgotPassword from "../components/Pages/ForgotPassword";
import storeDetail from "../components/Pages/StoreDetail";
import menu from "../globals";
import UserCard, { AddUserCard, ModifyUserCard } from "../components/ProfileManagement/UserCard";
import { PrivateRoute } from "./PrivateRoute";
import { PublicRoute } from "./PublicRoute";
import AccountConfirmation from "../components/Pages/AccountConfirmation";
import Approve from "../components/Pages/Approve";
import Terms from "../components/Pages/Terms";

// Route is accessible by anybody
// PublicRoute is only accessible by non connected users
// PrivateRoute is only accessible by connected users

export default function Routes() {
    return (
        <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/confirm-account" exact component={AccountConfirmation} />
            <Route path="/reset-password" exact component={AccountConfirmation} />
            <Route path="/oauth/approve" exact component={Approve} />
            <Route path="/terms" exact component={Terms} />
            <PublicRoute path="/signin" exact component={SignIn} />
            <PublicRoute path="/signup" exact component={SignUp} />
            <PublicRoute path="/forgot-password" exact component={ForgotPassword} />
            <PrivateRoute path="/adduser" exact component={AddUserCard} />
            <PrivateRoute path="/showUser" exact component={UserCard} />
            <PrivateRoute path="/modifyuser" exact component={ModifyUserCard} />
            <PrivateRoute path="/store" exact component={storeDetail} />
            {menu.map((item) => (
                item.public ?
                <Route path={item.route} exact component={item.component} />
                :
                <PrivateRoute path={item.route} exact component={item.component} />
            ))}
        </Switch>
    );
}
